    type: property
    summary: |-
      연속 토큰 매개 변수는 다음 결과 집합을 얻는 데 사용됩니다. 연속 토큰은 시스템의 결과가 단일 응답에 맞지 않는 경우 API의 응답에 포함 됩니다. 이 값이 다음 API 호출에 전달되면 API는 다음 결과 집합을 반환합니다.
      결과가 더 이상 없으면 없으면 연속 토큰 응답에 포함 되지 않습니다.
